import React from "react";
import "../styles/header.css";
import Nav from "react-bootstrap/Nav";

const Footer = () =>{
    return(
        <div className="footerContainer d-flex justify-content-center" > 
            <Nav className="justify-content-center" activeKey="/home" bg="light">
                <Nav.Item>
                <Nav.Link href="/home">Home</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-1">Terms & Conditions</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-2">Contact</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-3">FAQ</Nav.Link>
                </Nav.Item>
            </Nav>
        </div>
        
    );
}

export default Footer;
